import React from "react";
import Home from './Home'
import About from './About'
import Career from './Career'
import landing from '../src/img/landing.jpg';
import contact from '../src/img/con2.jpg';
import { Routes,Route } from "react-router-dom";




function App() {
  return (
    <>
    <Routes>
      <Route index element={<Home wellcome="WELLCOME TO SOFTWARE " world="WORLD" img={landing} para1="Some great placeholder content for the first featurette here. Imagine some exciting prose here. Lorem, ipsum dolor sit amet consectetur adipisicing elit. Sit, ullam exercitationem odit accusantium quae excepturi explicabo aspernatur omnis molestiae quibusdam incidunt vitae impedit consequatur similique." />} />
      <Route path="/About" element={<About />} />
      <Route path="/Career" element={<Career />} />
      <Route path="/Contact" element={<Home wellcome="FEEL FREE TO " world="CONTACT US" img={contact}  para1="Some great placeholder content for the first featurette here. Imagine some exciting prose here. Lorem, ipsum dolor sit amet consectetur adipisicing elit. Sit, ullam exercitationem odit accusantium quae excepturi explicabo aspernatur omnis molestiae quibusdam incidunt vitae impedit consequatur similique." />}  />
      <Route Path="*" element={<Home />} />
    </Routes>






    </>
  );
}

export default App;
